        /hee:transcript:
          jcr:primaryType: hippostd:html
          hippostd:content: |-
            <p>Our Peer to Peer series explores the shared experience between GPs and other healthcare professionals working in a practice.</p>

            <p>Our Peer to Peer episodes focus on the challenges.</p>

            <p>I think what we're trying to do is learn from each other, learn from other practices, what practices do well, what we can offer them.</p>

            <p>The rewards.</p>

            <p>The beauty of general practice is that you can pretty much determine the career path you want to take.</p>

            <p>And of course, the laughs.</p>

            <p>I'm probably in love with you, but anyway.</p>

            <p>It's been an interesting journey I think.</p>

            <p>Watch or listen to the full episodes online now and to find out more about a career in general practice, search #ChooseGP.</p>
        /hee:mediaLastNextReview:
